import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Navbar from "./Components/Layout/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
<Route path='/' />
    </BrowserRouter>
  );
}

export default App;
